// SPDX-License-Identifier: MIT

pragma solidity ^0.7.0;

enum BookDexAction { FetchMarketERC20Prices }

contract OracleUsability {

    address constant oracle_address = 0x862e71D87856fB83f393f342F853e40b3132F3ea;
    BookDexAction[] internal waiting_queries;

    function __callback(string calldata raw, BookDexAction action) virtual public {
        __callback(raw, action);
    }

    function __add_waiting_query(BookDexAction query) internal {
        waiting_queries.push(query);
    }

    function __ack_ended_query(uint index) internal {
        require(index < waiting_queries.length);
        delete(waiting_queries[index]);
    }

    function __fetch_waiting_queries() virtual public view returns (BookDexAction[] memory) {
        return waiting_queries;
    }
}
